import React, { Component } from "react";
import styled, { css } from "styled-components";
import { Slider } from "material-ui-slider";

const EarlyLifeSection = (monthlyCallback, yearsCallback) => {
  return (
    <EarlyLife>
      <MonthlySavingsTitleStack>
        <MonthlySavingsTitle>Monthly Savings</MonthlySavingsTitle>
        <Slider
          defaultValue={50}
          style={{
            position: "absolute",
            top: 27,
            left: 0,
            height: 30,
            width: 318
          }}
          input={(e) => monthlyCallback(e.target.value)}
        />
      </MonthlySavingsTitleStack>
      <NumberOfYears>Number of Years</NumberOfYears>
      <Slider
        defaultValue={50}
        style={{
          height: 30,
          width: 318,
          marginTop: 4,
          marginLeft: 29
        }}
        input={(e) => yearsCallback(e.target.value)}
      />
    </EarlyLife>
  );
}

const EarlyLife = styled.div`
  background-color: #ff7201;
  flex-direction: column;
  display: flex;
  flex: 1 1 0%;
`;

const MonthlySavingsTitle = styled.span`
  font-family: Roboto;
  top: 0px;
  left: 54px;
  position: absolute;
  font-style: normal;
  font-weight: 400;
  color: rgba(255,255,255,1);
  height: 28px;
  width: 206px;
  text-align: center;
  font-size: 18px;
`;

const MonthlySavingsTitleStack = styled.div`
  width: 318px;
  height: 57px;
  margin-top: 24px;
  margin-left: 29px;
  position: relative;
`;

const NumberOfYears = styled.span`
  font-family: Roboto;
  font-style: normal;
  font-weight: 400;
  color: rgba(255,255,255,1);
  height: 28px;
  width: 206px;
  text-align: center;
  font-size: 18px;
  margin-top: 48px;
  margin-left: 83px;
`;

export default EarlyLifeSection;
